import React from 'react';
import { FirstName, LastName } from './App';
const ComC = () => {
  return (
    <>
      <FirstName.Consumer>
        {(value) => {
          return <h1>My Name is {value}</h1>;
        }}
      </FirstName.Consumer>
    </>
  );
};
export default ComC;

